<!DOCTYPE html>
<html lang="en">

<head>
  <title>Auth</title>
  <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=IBM+Plex+Sans">
  <style>
    body {
      margin: 0;
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
      background: #004182;
      font-family: "IBM Plex Sans", "sans";
      color: #f5f9fc;
    }

    .title-box {
      font-size: 12px;
      inline-size: max-content;
    }

    .replit-auth-error {
      padding: 1em;
      max-width: 30em;
    }

    .message {
      display: flex;
      flex-direction: column;
      align-items: center;
    }

    @media (max-width: 500px) {
      .message {
        flex-direction: column;
        align-items: center;
      }
    }

    .eval-bot {
      margin: 2em;
    }

    .console {
      background-color: #0e1628;
      color: #fff;
      font-family: "IBM Plex Sans", "sans";
      padding: 1em;
      margin: 1em;
    }

    .footer {
      margin: 3em 1em 1em 1em;
      text-align: center;
    }

    .link-icon {
      margin-right: 20px;
      margin-top: 4px;
    }

    .auth-text {
      font-family: 'IBM Plex Sans';
      font-style: normal;
      font-weight: 500;
      font-size: 16px;

      align-items: center;
      text-align: center;
      margin-left: 8px;
       

      color: #F5F9FC;
    }

    .auth-sign-up {
      cursor: pointer;
    }


    .auth-icon {
       

      flex: none;
      order: 0;
      flex-grow: 0;
    }

    .replit-auth-button {
      display: flex;
      justify-content: center;
      align-items: center;
      padding: 8px;
      margin: auto;

      border: none;
      cursor: pointer;

       

      background: #1C2333;
      border-radius: 8px;
    }

    .replit-auth-button:hover {
      background: #2f3a52
    }

    a {
      color: #c2c8cc;
    }
  </style>

  <script>
    var reload_timeout = setTimeout(function () {
      window.location.reload();
    }, 60000);
  </script>
</head>

